script: |
  super -f tsv -I q9612.sql | sort > q9612.out

vector: true

inputs:
  - name: q9612.sql
    data: |
      SELECT DISTINCT * FROM tab0 AS cor0 WHERE NOT col1 + CAST ( + - col0 AS INTEGER ) NOT BETWEEN 84 * 67 AND - col2 * col2 * + 73 / 99 OR NULL IS NULL;
  - name: tab0

outputs:
  - name: q9612.out
    data: |
      15	81	47
      87	21	10
      97	1	99
